import React from "react";
import { Route } from "react-router-dom";




import ApplicantList from "./containers/job_application/applicant/ApplicantListView";
import ApplicantDetail from "./containers/job_application/applicant/ApplicantDetailView";

import ApplicationList from "./containers/job_application/application_made/Application_madeListView";
import ApplicationDetail from "./containers/job_application/application_made/Application_madeDetailView";



import SignUp from "./containers/templates/signup";
import SignIn from "./containers/templates/login";
import Logout from "./containers/templates/logout";
import homepage from "./containers/templates/homepage";



const BaseRouter = () => (
  <div>
    <Route exact path="/" component={homepage} />{" "} 


    <Route exact path="/applicant" component={ApplicantList} />{" "} 
    <Route exact path="/applicant/:applicantID/" component={ApplicationDetail} />{" "} 

    <Route exact path="/applications" component={ApplicationList} />{" "} 
    <Route exact path="/applications/:applicationID/" component={ApplicantDetail} />{" "} 



    <Route exact path="/register/" component={SignUp} />{" "} 
    <Route exact path="/login/" component={SignIn} />{" "} 
    <Route exact path="/logout/" component={Logout} />{" "} 


  </div>
);

export default BaseRouter;
